const e=JSON.parse('{"key":"v-31539972","path":"/further/backend/importAndExport.html","title":"导入与导出","lang":"en-US","frontmatter":{},"headers":[{"level":2,"title":"前提准备","slug":"前提准备","link":"#前提准备","children":[]},{"level":2,"title":"数据导出","slug":"数据导出","link":"#数据导出","children":[{"level":3,"title":"快捷导出","slug":"快捷导出","link":"#快捷导出","children":[]},{"level":3,"title":"自定义导出","slug":"自定义导出","link":"#自定义导出","children":[]},{"level":3,"title":"导出空模板","slug":"导出空模板","link":"#导出空模板","children":[]}]},{"level":2,"title":"数据导入","slug":"数据导入","link":"#数据导入","children":[{"level":3,"title":"快捷导入","slug":"快捷导入","link":"#快捷导入","children":[]},{"level":3,"title":"自定义导入","slug":"自定义导入","link":"#自定义导入","children":[]}]}],"git":{"createdTime":1701780913000,"updatedTime":1701780913000,"contributors":[{"name":"Moments","email":"554676262@qq.com","commits":1}]},"readingTime":{"minutes":3.27,"words":981},"filePathRelative":"further/backend/importAndExport.md","localizedDate":"December 5, 2023","excerpt":"<h1> 导入与导出</h1>\\n<p>对于企业来讲，对报表之类的数据很重视，往往需要经常导出数据。而财务或者销售相关的数据会经常按月或季度来导入到系统。</p>\\n<p>我们为此设计了一套 <a href=\\"/further/backend/annotation.html#excel%E7%9B%B8%E5%85%B3%E6%B3%A8%E8%A7%A3\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">注解</a>，配合使用</p>\\n<h2> 前提准备</h2>\\n<div class=\\"hint-container tip\\">\\n<p class=\\"hint-container-title\\">Tips</p>\\n<p>首先我们要创建一个<code>DTO（data to object）</code>类，该类要实现 <code>MineModelExcel</code> 接口（目前是个空接口，不需要做任何实现）</p>\\n<p>在类上面加上 <code>#[ExcelData]</code> 注解，类里面定义类属性，映射要 <code>导入/导出</code> 的数据库字段，该字段上面加上 <code>@ExcelProperty</code> 注解。</p>\\n<p>并且注解里设置相关属性，其中 <code>value</code> 和 <code>index</code> 是必须设置的项</p>\\n</div>"}');export{e as data};
